import React from "react";

import { GlobalStyle} from './commons'
import { StylesProvider } from '@material-ui/styles'
import { CssBaseline } from '@material-ui/core'

function App() {
  return (
    <StylesProvider injectFirst>
      <CssBaseline/>
      <GlobalStyle/>
      <div> teste </div>
    </StylesProvider>
  )
}

export default App;
